import React, { Component } from 'react'
import { FaHome } from 'react-icons/fa'

export default class Sidebar extends Component {
    render() {
        return (
            <div className="sidebar">
                <ul className="sidebar-items">
                    <li><FaHome />Dashboard</li>
                </ul>
            </div>
        )
    }
}
